import React, {useEffect, useState} from "react";

function NextPath({lpath}) {
    const [backend, setBackend] = useState([{}]);
    const [show, setShow] = useState(false);
    const [nextp, setNextp] = useState("");

    useEffect(() => {
        console.log(lpath[0])
        fetch(`path/${lpath}`).then(
          response => response.json()
        ).then(
          data => {
            setBackend(data)
            console.log(data)
          }
        )
      }, [])

    return (
        <div className="App">
            {(typeof backend.last_path === 'undefined') ? (
                <p>Loading...</p>
            ): (
                backend.last_path.map((children, i) => (
                <button type="button" key={i} onClick={()=>setShow(true) && setNextp(children)}>{children}</button>

                // <p key={i}>{children}</p>
                ))

            )}
            {show && <NextPath lpath={nextp} />}
        </div>
    )
}
export default NextPath;
